import React from "react";
import ListItem from "./ListItem";
import NavBar from "./NavBar";
import $ from "jquery";

export default class AppF extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      id: "",
      backgroundImg: ""
    };
  }
  componentDidMount() {
    this.getData();
  }
  getData() {
    console.log(this.state.data);
    var that = this;

    $.ajax({
      url: "/shops",
      type: "GET",
      data: this.state,
      success: function(data) {
        // if (data.id === window.location.pathname.slice(7))
        console.log(data);
        this.setState({
          backgroundImg: this.state.backgroundImg
        });
        console.log(this.state);
      }.bind(this),
      error: function(err) {
        console.log("error");
      }
    });
  }
  render() {
    return (
      <div>
        <NavBar />
        <img
          src={this.state.backgroundImg}
          alt="hall"
          width="100%"
          height="600px"
        ></img>
        <ListItem />
      </div>
    );
  }
}
